var tipuesearch = {"pages": [{'title': 'WEEK', 'text': 'WEEK1~5 \n', 'tags': '', 'url': 'WEEK.html'}, {'title': 'WEEK1~5', 'text': "WEEK1 \n 建立自己的倉儲 \n 1.在GITHUB上新增倉儲cd2020 \n 2.git clone到自己的隨身碟 \n 3.在黑窗打 git submodule add https://github.com/mdecourse/cmsimde.git \n 4.就可以開啟進態網頁 開使編輯 \n \n \n WEEK2 \n 更新PYTHON到2.8.3 \n 1.先在cd2020裡新增data \n 2.進去再新增py283 protablegit與wscite432 \n 3. 進入官網打PYTHON2.8.3下載下來 \n 4.不要點PIP按NEXT \n 5.好了之後解壓縮到CD2020 \n 6.在裡面先用好這三個資料夾 \n 7.檔案放進去解壓縮 \n 8.在外面也用好STAR跟STOP \n 9.把程式打進去改檔名 \n \n WEEK3 \n 亂數分組程式-乙班 \n import random\ngroupList=[['40723201','40723202','40723203','40723204','40723205','40723206','40723207','40723208','40723209','40723210','40723211','40723212','40723213','40723214','40723215','40723216','40723217','40723218','40723219','40723220','40723221','40723222''40723223','40723224','40723225','40723226','40723227','40723228','40723229','40723230','40723231','40723232','40723233','40723234','40723235','40723236','40723237','40723238','40723239','40723240','40723241','40723242','40723243','40723244','40723245','40723246','40723247','40723248','40723249','40723250','40723251','40723252','40723253','40723254','40723255']]\n#分組參數\n\ngroup=grouplist[0]\nrandom.shffle(group)\n#將數列隨機排列\nprint(group)\n#複製數列\nprint(group[0:10])\n#抽取數列(1~10)\nprint(group[11:20])\n#抽取數列(11~20)\nprint(group[21:30])\n#抽取數列(21~30)\nprint(group[31:40])\n#抽取數列(31~50)\nprint(group[41:50])\n#抽取數列(41~50)\nprint(group[51:55])\n#抽取數列(51~55) \n", 'tags': '', 'url': 'WEEK1~5.html'}, {'title': 'Assignment', 'text': '\n', 'tags': '', 'url': 'Assignment.html'}, {'title': 'Assignment1', 'text': 'PDF \n \n (電腦沒WORD所以先打在這邊) \n 心得 : 這次的祖耀工作是寫出亂數分組程式，經過這次的學習有比較聊解PYTHON的程式寫法，不過還只是簡單的。', 'tags': '', 'url': 'Assignment1.html'}, {'title': 'About', 'text': '此內容管理系統以\xa0 https://github.com/mdecourse/cmsimde \xa0作為 submodule 運作, 可以選定對應的版本運作, cmsimde 可以持續改版, 不會影響之前設為 submodule, 使用舊版 cmsimde 模組的內容管理相關運作. \n 利用 cmsimde 建立靜態網誌方法: \n 1. 在 github 建立倉儲, git clone 到近端 \n 2. 參考\xa0 https://github.com/mdecourse/newcms , 加入除了 cmsimde 目錄外的所有內容 \n 以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde \n 建立 cmsimde 目錄, 並從 github 取下子模組內容. \n 3.在近端維護時, 更換目錄到倉儲中的 cmsimde, 以 python wsgi.py 啟動近端網際伺服器. \n 動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 4. 之後若要以 git clone 取下包含 submodule 的所有內容, 執行: \n git clone --recurse-submodules  https://github.com/mdecourse/newcms.git \n', 'tags': '', 'url': 'About.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數. \n 等變數.', 'tags': '', 'url': 'Develop.html'}]};